const e=[{id:"wax-pdf-2",question:"Biggest reason wax is dimensionally unstable vs other materials:",options:["High CTE","High strength","High k","High density"],correctAnswerIndex:0,explanation:"✅ Answer: A Wax has very high thermal expansion (CTE)."},{id:"wax-pdf-5",question:"Cause of shape change hours after carving:",options:["Elastic memory","Hygroscopy","Corrosion","Polymerization"],correctAnswerIndex:0,explanation:"✅ Answer: A Wax relieves trapped stresses over time."},{id:"wax-pdf-10",question:"Main base wax:",options:["Paraffin","Rosin","Gypsum","Eugenol"],correctAnswerIndex:0,explanation:"✅ Answer: A Paraffin is the main body (often 40–60%)."},{id:"wax-pdf-13",question:"During inlay wax manipulation, dry heat is preferred over a water bath. The main reason is that a water bath can:",options:["Cause staining of wax","Introduce water droplets into wax","Increase radiopacity of wax","Cause corrosion of wax"],correctAnswerIndex:1,explanation:"✅ Answer: B Water droplets incorporated into wax can cause varying expansion and spattering (smearing) during heating."},{id:"wax-pdf-18",question:"Highest thermal conductivity (k):",options:["Wax","Metal","Ceramic","PMMA"],correctAnswerIndex:1,explanation:"✅ Answer: B Metals transfer heat fastest."},{id:"wax-pdf-20",question:"Material that softens over a range (not a single sharp point):",options:["Pure metal","Wax","Gypsum","Ceramic"],correctAnswerIndex:1,explanation:"✅ Answer: B Wax is a mixture → softens over a melting range."},{id:"wax-pdf-21",question:"Material with sharp melting point:",options:["Wax","Pure metal","PMMA","Alginate"],correctAnswerIndex:1,explanation:"✅ Answer: B Pure metals melt at a defined temperature."},{id:"wax-pdf-23",question:"Material designed for elastic recovery after removal from undercuts:",options:["Inlay wax","Elastomer impression","Gypsum die","Ceramic"],correctAnswerIndex:1,explanation:"✅ Answer: B Elastomers are meant to recover elastically."},{id:"wax-pdf-26",question:"Pattern material that must burn out cleanly to leave a mold:",options:["Wax pattern","Gypsum die","Ceramic crown","Metal coping"],correctAnswerIndex:0,explanation:"✅ Answer: A Lost-wax needs clean burnout → clean cavity."},{id:"wax-pdf-29",question:"The biggest reason direct wax patterns are less accurate than indirect:",options:["No die needed","Mouth→room temp change","Wax is radiolucent","Wax is brittle"],correctAnswerIndex:1,explanation:"✅ Answer: B Cooling causes thermal contraction + distortion."},{id:"wax-pdf-30",question:"Material that is chemically set (not thermoplastic):",options:["Wax","Gypsum","Impression compound","PMMA sheet"],correctAnswerIndex:1,explanation:"✅ Answer: B Gypsum hardens by a setting reaction."},{id:"wax-pdf-32",question:"Which pair is correct?",options:["Wax = chemical set; gypsum = thermoplastic","Wax = thermoplastic; gypsum = chemical set","Wax = crystalline lattice; metal = amorphous","Wax = rigid; ceramic = flexible"],correctAnswerIndex:1,explanation:"✅ Answer: B Wax softens with heat; gypsum sets chemically."},{id:"wax-pdf-34",question:"A wax pattern leaves a film inside the mold after burnout. The most likely casting effect is:",options:["Surface defect/misfit","Stronger casting","Higher conductivity","Less porosity always"],correctAnswerIndex:0,explanation:"✅ Answer: A Residue coats mold wall → poor surface/fit."},{id:"wax-pdf-35",question:"Best material for rigid die (carving margins against it):",options:["Wax","Gypsum die stone","Alginate","Elastomer impression"],correctAnswerIndex:1,explanation:"✅ Answer: B Die must be rigid and stable."}],t=[{id:"wax-pdf-1",question:"Direct wax pattern → looser casting mainly due to:",options:["Expansion","Contraction","Corrosion","Setting"],correctAnswerIndex:1,explanation:"✅ Answer: B Mouth → room cooling causes thermal contraction + distortion."},{id:"wax-pdf-4",question:"A wax pattern looks perfect on the die, but after 1–2 hours the margins open slightly. The BEST step to prevent this is:",options:["Bench storage","Immediate investing","Reheating margins","Finger pressure"],correctAnswerIndex:1,explanation:"✅ Answer: B Wax undergoes stress relaxation/elastic memory with time; immediate investing locks the pattern inside the set investment, so it can’t deform later."},{id:"wax-pdf-6",question:"You’re assisting in clinic. The operator says: “I’m doing a direct wax pattern for an inlay. Warm the wax, adapt it inside the prepared cavity in the mouth, carve margins at oral temperature, then remove it without distortion.” Which wax is indicated?",options:["Type I inlay wax","Type II inlay wax","Baseplate wax","Sticky wax"],correctAnswerIndex:0,explanation:"✅ Answer: A Type I is for direct intraoral waxing and is formulated to resist distortion at 37°C."},{id:"wax-pdf-7",question:"Lab bench scenario The patient has left. You’re at the bench with a stone die. Your technician says: “Make the inlay wax pattern on the die using the indirect technique. Pick the wax that comes in soft/medium/hard grades for lab waxing.” Which wax is indicated?",options:["Type I inlay wax","Type II inlay wax","Bite registration wax","Boxing wax"],correctAnswerIndex:1,explanation:"✅ Answer: B Type II is designed for indirect waxing on die/model and is supplied in different hardness grades."},{id:"wax-pdf-8",question:"At 37°C, the maximum permitted flow for Type I inlay wax is:",options:["≤ 1%","≤ 20%","≤ 50%","70–90%"],correctAnswerIndex:0,explanation:"✅ Answer: A Very low flow at mouth temperature prevents distortion during carving/removal."},{id:"wax-pdf-9",question:"At 45°C, the required flow range for Type I and Type II inlay wax is:",options:["≤ 1%","≤ 20%","≤ 50%","70–90%"],correctAnswerIndex:3,explanation:"✅ Answer: D High flow at 45°C allows wax to adapt and reproduce fine detail."},{id:"wax-pdf-11",question:"A paraffin-based inlay wax produces a rough, flaky surface when trimmed and fails to develop a smooth glossy finish. Which additive is specifically incorporated to improve smoothness and luster and to reduce cracking/flaking?",options:["Dammar resin","Rosin","Water","Silica"],correctAnswerIndex:0,explanation:"✅ Answer: A Dammar resin modifies paraffin by increasing toughness and smoothness, making the wax less prone to flaking/cracking and giving a better luster."},{id:"wax-pdf-12",question:"An inlay wax must resist distortion at oral temperature while still producing a smooth, glossy surface. Which component is added to decrease flow at mouth temperature and increase surface gloss?",options:["Carnauba wax","Glycerin","Plaster","Alcohol"],correctAnswerIndex:0,explanation:"✅ Answer: A Carnauba wax is a hard, high–melting point wax that reduces flow at 37°C and improves gloss."},{id:"wax-pdf-14",question:"In the lost-wax technique, the inlay wax pattern represents the restoration as a:",options:["Positive pattern","Negative mold","Die spacer","Separating film"],correctAnswerIndex:0,explanation:"✅ Answer: A The wax pattern is the positive replica of the final restoration."},{id:"wax-pdf-15",question:"After the wax pattern is eliminated during burnout, the investment contains a:",options:["Positive replica","Negative mold cavity","Separating layer","Die relief space"],correctAnswerIndex:1,explanation:"✅ Answer: B Burnout removes the wax and leaves a negative mold space that will be filled by molten alloy."},{id:"wax-pdf-17",question:"Highest thermal expansion (CTE) among these:",options:["Wax","Ceramic","Metal","Gypsum"],correctAnswerIndex:0,explanation:"✅ Answer: A Wax has the highest CTE → biggest size change with small temperature change."},{id:"wax-pdf-19",question:"Lowest thermal conductivity (k) (heats unevenly most):",options:["Metal","Ceramic","Wax","Gypsum"],correctAnswerIndex:2,explanation:"✅ Answer: C Wax is a poor heat conductor → surface softens first."},{id:"wax-pdf-22",question:"“Elastic memory” causing pattern distortion with time best matches:",options:["Wax","Gypsum","Ceramic","Metal"],correctAnswerIndex:0,explanation:"✅ Answer: A Wax releases trapped stresses → shape changes later."},{id:"wax-pdf-24",question:"“Creep” at room/mouth conditions is most problematic for:",options:["Wax","Ceramic","Gypsum","Glass"],correctAnswerIndex:0,explanation:"✅ Answer: A Wax is viscoelastic → deforms under small loads over time."},{id:"wax-pdf-25",question:"Best step to stop wax “creep/memory” from ruining accuracy:",options:["Store overnight","Invest immediately","Reheat repeatedly","Press hard while cooling"],correctAnswerIndex:1,explanation:"✅ Answer: B Set investment locks the pattern → no later distortion."},{id:"wax-pdf-27",question:"If burnout leaves residue, the main problem is:",options:["Higher CTE","Mold wall coating","Higher hardness","Higher k"],correctAnswerIndex:1,explanation:"✅ Answer: B Residue coats mold walls → casting defects/misfit."},{id:"wax-pdf-28",question:"Most “dimensionally stable” with temperature change (lowest thermal distortion risk):",options:["Wax","Metal","PMMA","Impression compound"],correctAnswerIndex:1,explanation:"✅ Answer: B Compared to wax/PMMA, metals change less with small temp changes."},{id:"wax-pdf-31",question:"Material that undergoes polymerization shrinkage (not “cooling shrinkage”):",options:["Wax","PMMA denture base","Metal alloy","Ceramic"],correctAnswerIndex:1,explanation:"✅ Answer: B PMMA shrinks mainly by polymerization + processing."},{id:"wax-pdf-33",question:"A direct wax pattern is removed from the mouth; the operator keeps holding it between fingers “to inspect margins.” Most likely outcome:",options:["Better fit","Distortion","Stronger wax","Cleaner burnout"],correctAnswerIndex:1,explanation:"✅ Answer: B Finger heat causes temperature change → wax dimension shifts/distorts."},{id:"wax-pdf-36",question:"Glass transition temperature (Tg) concept fits best with:",options:["Wax becomes soft/plastic near Tg","Metal becomes plastic near Tg","Gypsum melts at Tg","Ceramic flows at Tg"],correctAnswerIndex:0,explanation:"✅ Answer: A Near Tg, wax shifts from stiff → more plastic/flowable."}],a=[{id:"wax-pdf-3",question:"When softening inlay wax, the best reason to heat it slowly and allow “soak time” is because wax has:",options:["Rapid heat spread","Poor heat spread","High stiffness","High strength"],correctAnswerIndex:1,explanation:"✅ Answer: B Wax has low thermal conductivity, so if you don’t heat slowly/allow soak time, the outside overheats and becomes too soft/runny while the core stays firm → you get uneven flow, poor adaptation, and a higher chance of pattern distortion."},{id:"wax-pdf-16",question:"In a paraffin-rich inlay wax, the point near ~35°C where the rate of thermal expansion increases abruptly and the wax becomes more plastic is called:",options:["Melting point","Glass transition temperature","Boiling point","Dew point"],correctAnswerIndex:1,explanation:"✅ Answer: B Glass transition temperature is where wax shifts toward a more plastic/rubbery behavior and its thermal expansion rate changes sharply (commonly around 35°C in paraffin-rich inlay waxes) Below Tg: molecules are “stuck” → wax stays hard. At Tg: molecules start slipping past each other → wax becomes soft/plastic and flows more, so its expansion also increases faster."}],n=[...e,...t,...a];export{t as W,n as a,a as b,e as c};
